n  &lt;td&gt;path_model&lt;/td&gt;\n  &lt;td&gt;bestRF&lt;em&gt;SQN&lt;/em&gt;ahead&lt;em&gt;8&lt;/em&gt;m_16.joblib&lt;/td&gt;\n&lt;/tr&gt;\n&lt;tr&gt;\n  &lt;td&gt;m&lt;/td&gt;\n  &lt;td&gt;16&lt;/td&gt;\n&lt;/tr&gt;\n&lt;/tbody&gt;\n&lt;/table&gt;\n\n&lt;p&gt;Source Code:&lt;/p&gt;\n\n&lt;pre&gt;&lt;code&gt;class MyStrategy(bt.Strategy):\n    params = (('path_model', 'bestRF_SQN_ahead_8_m_16.joblib'),\n              ('m', 16),\n              ('stoptype', bt.Order.StopTrail),\n              ('trailpercent',0.000))  # price is 2% less than the entry point\n\n\n    def __init__(self):          \n        self.lines.rf = MyRFIndicator(self.data, path_model=self.p.path_model, m=self.p.m)\n        self.ahead_time = 8\n        self.timeIni = None \n#         self.order = None\n\n    def notify_order(self, order):\n        ''' \u00bfPor qu\u00e9 usar notify_order?\n        Porque esto asegura que la orden que debe ser controlada por el Stop realmente se ha ejecutado. Esto puede no ser un gran problema \n        durante las pruebas de backtesting, pero lo es cuando se opera en vivo.   \n        ''' \n        if not order.status == order.Completed:\n            return  # discard any other notification\n\n        if not self.position:  # we left the market\n            print('SELL@price: {:.2f}'.format(order.executed.price))\n            return\n\n        # We have entered the market\n        print('BUY @price: {:.2f}'.format(order.executed.price))\n\n\n\n    def next(self):       \n        if not self.position:  # not in the market\n            self.timeIni = len(self.data)\n\n            if self.lines.rf[0] == 1:                 \n                size = int(self.broker.get_cash() / self.data)\n                self.buy(size=size)\n                # Stop trail       \n#                 self.buy(size=size, exectype=self.p.stoptype, trailpercent=self.p.trailpercent)\n#                 self.sell(size=size, exectype=self.p.stoptype, trailpercent=self.p.trailpercent)\n\n            # print('COMPRO!')                \n            elif self.lines.rf[0] == 0:\n                size = int(self.broker.get_cash() / self.data)\n                self.sell(size=size)\n#                 self.sell(size=size, exectype=self.p.stoptype, trailpercent=self.p.trailpercent)\n                # Stop trail       \n#                 self.buy(size=size, exectype=self.p.stoptype, trailpercent=self.p.trailpercent)\n\n#                 print('VENDO!')                        \n        elif self.position:  # in the market\n            if len(self.data) &amp;gt; self.timeIni + self.ahead_time:\n                self.close()  # close long position\n\n&lt;/code&gt;&lt;/pre&gt;\n\n&lt;hr /&gt;\n\n&lt;h1&gt;Data Feeds&lt;/h1&gt;\n\n&lt;h2&gt;PandasData&lt;/h2&gt;\n\n&lt;table class=\"metaDataTable\"&gt;\n&lt;thead&gt;\n&lt;tr&gt;\n  &lt;th&gt;Property&lt;/th&gt;\n  &lt;th&gt;Value&lt;/th&gt;\n&lt;/tr&gt;\n&lt;/thead&gt;\n&lt;tbody&gt;\n&lt;tr&gt;\n  &lt;td&gt;DataName:&lt;/td&gt;\n  &lt;td&gt;Open     High      Low    Close  Volume&lt;/td&gt;\n&lt;/tr&gt;\n&lt;/tbody&gt;\n&lt;/table&gt;\n\n&lt;p&gt;&lt;DATE&gt;_&lt;TIME&gt; &lt;br /&gt;\n2019-07-01 00:00:00  1.13670  1.13688  1.13585  1.13652       0\n2019-07-01 01:00:00  1.13654  1.13682  1.13626  1.13681       0\n2019-07-01 02:00:00  1.13681  1.13707  1.13597  1.13597       0\n2019-07-01 03:00:00  1.13597  1.13636  1.13535  1.13536       0\n2019-07-01 04:00:00  1.13535  1.13549  1.13476  1.13511       0\n...                      ...      ...      ...      ...     ...\n2019-12-31 18:00:00  1.12237  1.12311  1.12160  1.12263       0\n2019-12-31 19:00:00  1.12263  1.12293  1.12227  1.12288       0\n2019-12-31 20:00:00  1.12290  1.12290  1.12225  1.12232       0\n2019-12-31 21:00:00  1.12232  1.12235  1.12165  1.12167       0\n2019-12-31 22:00:00  1.12167  1.12178  1.12144  1.12171       0&lt;/p&gt;\n\n&lt;p&gt;[3133 rows x 5 columns]|\n|Timezone:|None|\n|Number of bars:|3133|\n|Bar Length:|1 Day|&lt;/p&gt;\n\n&lt;hr /&gt;\n\n&
